import React, { useState, useEffect } from 'react';
import './Historial.css';

const Historial = () => {
  const [solicitudes, setSolicitudes] = useState([]);
  const [detalles, setDetalles] = useState({});

  useEffect(() => {
    fetch('http://localhost:8081/api/solicitudes')
      .then(res => res.json())
      .then(data => setSolicitudes(data))
      .catch(err => console.error('Error cargando solicitudes:', err));
  }, []);

  const toggleDetalles = async (id) => {
    if (detalles[id]) {
      setDetalles(prev => ({ ...prev, [id]: null }));
    } else {
      try {
        const [meds, vuelos] = await Promise.all([
          fetch(`http://localhost:8081/api/solicitud-medicamentos/solicitud/${id}`).then(res => res.json()),
          fetch(`http://localhost:8081/api/vuelos/solicitud/${id}`).then(res => res.json())
        ]);

        const vuelo = vuelos.length > 0 ? vuelos[0] : null;
        const dron = vuelo?.dron || null;

        setDetalles(prev => ({
          ...prev,
          [id]: {
            medicamentos: meds,
            vuelo,
            dron
          }
        }));
      } catch (error) {
        console.error('Error cargando detalles:', error);
      }
    }
  };

  return (
    <div className="contenedor-historial">
      {solicitudes.map(sol => (
        <div className="tarjeta-historial" key={sol.id}>
          <h3>Solicitud #{sol.id}</h3>
          <p><strong>Destino:</strong> {sol.destino}</p>
          <p><strong>Prioridad:</strong> {sol.prioridad}</p>
          <p><strong>Regi贸n:</strong> {sol.region}</p>
          <p><strong>Estado:</strong> {sol.estadoSolicitud}</p>
          <p><strong>Fecha solicitud:</strong> {new Date(sol.fechaSolicitud).toLocaleString()}</p>
          <button onClick={() => toggleDetalles(sol.id)}>
            {detalles[sol.id] ? 'Ocultar detalles' : 'Ver m谩s detalles'}
          </button>

          {detalles[sol.id] && (
            <div className="detalles">
              <h4>И Medicamentos</h4>
              {detalles[sol.id].medicamentos.length === 0 ? (
                <p>No hay medicamentos registrados</p>
              ) : (
                detalles[sol.id].medicamentos.map((med) => (
                  <div key={med.id} className="med-box">
                    <p><strong>Nombre:</strong> {med.medicamento?.nombreComercial}</p>
                    <p><strong>Cantidad:</strong> {med.cantidad}</p>
                    <p><strong>Peso:</strong> {med.medicamento?.peso} kg</p>
                    <p><strong>Descripci贸n:</strong> {med.medicamento?.descripcionUso}</p>
                    <p><strong>Forma de administraci贸n:</strong> {med.medicamento?.formaAdministracion}</p>
                    <p><strong>Dolores tratados:</strong> {med.medicamento?.dolores?.join(', ')}</p>
                  </div>
                ))
              )}

              <h4> Dron Asignado</h4>
              {detalles[sol.id].dron ? (
                <div className="dron-box">
                  <p><strong>ID:</strong> {detalles[sol.id].dron.id}</p>
                  <p><strong>Modelo:</strong> {detalles[sol.id].dron.modelo}</p>
                  <p><strong>Identificador:</strong> {detalles[sol.id].dron.identificador}</p>
                  <p><strong>Capacidad:</strong> {detalles[sol.id].dron.capacidadKg} kg</p>
                  <p><strong>Bater铆a:</strong> {detalles[sol.id].dron.nivelBateria}%</p>
                </div>
              ) : (
                <p>No se encontr贸 dron asignado.</p>
              )}

              <h4> Informaci贸n del Vuelo</h4>
              {detalles[sol.id].vuelo ? (
                <div className="vuelo-box">
                  <p><strong>Estado de entrega:</strong> {detalles[sol.id].vuelo.estadoEntrega}</p>
                  <p><strong>Duraci贸n:</strong> {detalles[sol.id].vuelo.duracionMinutos} minutos</p>
                  <p><strong>Distancia:</strong> {detalles[sol.id].vuelo.distanciaKm} km</p>
                  <p><strong>Inicio:</strong> {new Date(detalles[sol.id].vuelo.fechaInicio).toLocaleString()}</p>
                  <p><strong>Fin:</strong> {detalles[sol.id].vuelo.fechaFin ? new Date(detalles[sol.id].vuelo.fechaFin).toLocaleString() : 'En curso'}</p>
                </div>
              ) : (
                <p>No se registr贸 vuelo.</p>
              )}
            </div>
          )}
        </div>
      ))}
    </div>
  );
};

export default Historial;
